import React from "react";
import { BrowserRouter, Switch, Route } from "react-router-dom";
import Nav from "./components/nav";


function App () {
  return (
    <BrowserRouter>
        <Nav/>
      <Switch>
        <Route exact path="/"  >
        </Route>
        <Route path="/movie">
          <Movie />
        </Route>
        <Route path="/about(/:id)" component={Watch} />
        <Route component={Notfound} />
      </Switch>
    </BrowserRouter>
  );
}

export default App;
